import React from "react";

import "./collection-item.styles.scss";

const CollectionItem = ({ name, imageUrl, price }) => (
  <div>
    <div style={{ backgroundImage: `url(${imageUrl})` }}></div>
    <h2>{name}</h2>
    <span>${price}</span>
  </div>
);

export default CollectionItem;
